import React from 'react';
import { TableRow, TableCell } from '@mui/material';
import DisplayMetric from './DisplayMetric';


const MetricsRowComponent = ({ data }) => {
  console.log(data)

  return (
    <TableRow>
      <TableCell>
        {data.map((metric)=>(
          <DisplayMetric value={metric}/>
        ))
        }
      </TableCell>
    </TableRow>
  );
};

export default MetricsRowComponent;
